import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Login from "./components/login"

function App() {
  return (
    <Router>
      <switch>
        <Route path="/">
          <Login />
        </Route>
      </switch>
    </Router>
  );
}

export default App;
